webpackJsonp([0xa06d77e5b43e],{1195:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/is-it-time-to-use-visual-studio-code-as-your-ide/index.md absPath of file >>> MarkdownRemark",html:'<p>I am (currently) a fervent <a href="https://www.jetbrains.com/webstorm/">WebStorm IDE</a> user. Many on our Front-End Team are also WebStorm users, others are <a href="https://www.sublimetext.com/">Sublime Text</a> users and one or two use <a href="https://atom.io/">Atom.</a></p>\n<p>Recently though, the strangest thing has happened - developers on the Front-End team and others <em>outside</em> of the .Net team have been adopting <a href="https://code.visualstudio.com/">Visual Studio or Visual Studio Code</a> as their tool of choice for coding, and it\'s something that\'s been spreading through the team.</p>\n<p><img src="/content/images/2016/12/home-screenshot-mac-2x.png"></p>\n<p>So, what\'s the appeal? We\'ve done some (mostly unscientific) tests of the features of each tool side-by-side and actually, Visual Studio Code is pretty good. Intellisense - historically one of Visual Studio\'s best features - is pretty darn good, Git source control is built-in, and it has themes and plugins for other bits of functionality. We haven\'t put the debugging tools through their paces yet, but it makes me wonder - is it time for Microsoft to claw back some market share in the land of Front-End development?</p>',frontmatter:{title:"Is it time to use Visual Studio Code as your IDE?",date:"December 28, 2016",tags:["microsoft","tools"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/poképroject-dev-diary-day-seven/",tags:["SEO","Digital Marketing","Hackathon","Pokemon"],title:"PokéProject Dev Diary: Day Seven",date:"2016-10-06T21:01:01.030Z",description:"This thing ain’t gonna market itself.",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/1*9N5G_8K-XFMZxRNJAYtpBQ-83560993cf95101ff78b57d2414ec898-f2ac0.jpeg",srcSet:"/static/1*9N5G_8K-XFMZxRNJAYtpBQ-83560993cf95101ff78b57d2414ec898-567e3.jpeg 158w,\n/static/1*9N5G_8K-XFMZxRNJAYtpBQ-83560993cf95101ff78b57d2414ec898-c3206.jpeg 315w,\n/static/1*9N5G_8K-XFMZxRNJAYtpBQ-83560993cf95101ff78b57d2414ec898-f2ac0.jpeg 630w,\n/static/1*9N5G_8K-XFMZxRNJAYtpBQ-83560993cf95101ff78b57d2414ec898-0c4a5.jpeg 945w,\n/static/1*9N5G_8K-XFMZxRNJAYtpBQ-83560993cf95101ff78b57d2414ec898-4e530.jpeg 1200w",sizes:"(max-width: 630px) 100vw, 630px"}}}}},next:{frontmatter:{path:"/blog/explorative-prototyping/",tags:["hackathon","prototyping","programming"],title:"Explorative Prototyping",date:"2016-12-29T09:45:00.000Z",description:null,image:null}}}}}});
